{'lc_attributes': {}, 'lc_secrets': {}, 'metadata': {'source': '/content/files/936395_10K_2023_0000936395-23-000044.json', 'seq_num': 1, 'cik': '936395', 'company': 'CIENA CORP', 'filing_type': '10-K', 'filing_date': '2023-12-15', 'period_of_report': '2023-10-28', 'state_location': 'MD', 'fiscal_year_end': '1028', 'htm_filing_link': 'https://www.sec.gov/Archives/edgar/data/936395/000093639523000044/cien-20231028.htm', 'filename': '936395_10K_2023_0000936395-23-000044.htm'}, 'page_content': 'Keeping pace with the markets demands for technology innovation requires considerable research and development investment capacity. As a result, some of our competitors, both large and small, have chosen to rely upon component and module technology developed by and procured from third-party providers, including NTT Electronics, Marvell Technology Group and Cisco. We may compete with these providers, either indirectly as a result of their technology being a key enabling technology for our competitors or an alternative consumption model such as white box technology, or directly in module, pluggable and component sales opportunities.
As we promote our corporate strategy and seek increased customer adoption of our Blue Planet Automation Software, we expect to compete more directly with software vendors and traditional IT services vendors. Competitors for our Blue Planet Automation Software include Cisco, Nokia, Amdocs, Netcracker and Ericsson.
Across our markets and segments, the principal competitive factors can include, among others:
functionality, speed, capacity, scalability and performance of network solutions;
the ability to meet business needs and drive successful outcomes;
price for performance, cost per bit and total cost of ownership of network solutions;
incumbency and strength of existing business relationships;
technology roadmap and forward innovation capacity, including the ability to invest significant sums in research and development;
time-to-market in delivering products and features;
company stability and financial health;
ability to offer comprehensive networking solutions, consisting of hardware, software and services;
flexibility and openness of platforms, including ease of integration, interoperability and integrated management;
ability to offer solutions that accommodate a range of different consumption models;
operating costs and total cost of ownership;
software and network automation capabilities;', 'type': 'Document'},{'lc_attributes': {}, 'lc_secrets': {}, 'metadata': {'source': '/content/files/887733_10K_2022_0000887733-22-000017.json', 'seq_num': 1, 'cik': '887733', 'company': 'CENTRAL GARDEN & PET CO', 'filing_type': '10-K', 'filing_date': '2022-11-22', 'period_of_report': '2022-09-24', 'state_location': 'CA', 'fiscal_year_end': '0924', 'htm_filing_link': 'https://www.sec.gov/Archives/edgar/data/887733/000088773322000017/cent-20220924.htm', 'filename': '887733_10K_2022_0000887733-22-000017.htm'}, 'page_content': 'We are subject to cyber security risks and may incur increasing costs in an effort to minimize those risks.
Our business employs systems and websites that allow for the secure storage and transmission of proprietary or confidential information regarding our customers, employees, suppliers and others, including personally identifiable information. Security breaches could expose us to a risk of loss or misuse of this information, litigation, and potential liability. We may not have the resources or technical sophistication to anticipate or prevent rapidly-evolving types of cyber attacks. Attacks may be targeted at us, our customers and suppliers, or
others who have entrusted us with information. Actual or anticipated attacks may cause us to incur increasing costs, including costs to deploy additional personnel and protection technologies, train employees, and engage third-party experts and consultants. Advances in computer capabilities, new technological discoveries, or other developments may result in the technology used by us to protect transaction or other data being breached or compromised. In addition, data and security breaches can also occur as a result of non-technical issues, including breach by us or by persons with whom we have commercial relationships that result in the unauthorized release of personal or confidential information. Any compromise or breach of our security could result in a violation of applicable privacy and other laws, significant legal and financial exposure, and a loss of confidence in our security measures, which could have an adverse effect on our results of operations and our reputation.
Risks Relating to our Capital Stock
We do not expect to pay dividends in the foreseeable future.', 'type': 'Document'}
